import { Facebook, Instagram, Pinterest, Twitter } from "@mui/icons-material";
import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: auto;
  background-color: #24292f;
`;

const Left = styled.div`
  flex: 1;
  margin-left: 20px;
`;
const Logo = styled.h1`
  font-weight: bold;
  color: #ffffff;
`;
const Desc = styled.p`
  margin-top: 30px;
  font-weight: 500;
  color: white;
`;
const SocialContainer = styled.h4`
  margin-top: 30px;
  display: flex;
`;
const SocialIcon = styled.h4`
  cursor: pointer;
  width: 40px;
  height: 40px;
  border-radius: 50%;
  color: white;
  background-color: #${(props) => props.color};
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 5px;
`;
const Center = styled.div`
  flex: 1;
  color: white;
`;

const Title = styled.h4`
  text-align: center;
`
const List = styled.div`
  justify-content: center;
  align-content: center;
`
const ListItem= styled.li`
  
`
const Right = styled.div`
  flex: 1;
`;

const Fotter = () => {
  return (
    <Container>
      <Left>
        <Logo>ISURU.</Logo>
        <Desc>
          Our dresses are locally designed, in limited edition and crafted in
          beautiful lux fabrics from vintage satin and silk to everyday easy
          viscose. Wear them your way, with a blazer for work, with sneakers to
          lunch or with a statement heel for an event.
        </Desc>
        <SocialContainer>
          <SocialIcon color="0077ff">
            <Facebook />
          </SocialIcon>
          <SocialIcon color="fc466b" >
            <Instagram />
          </SocialIcon>
          <SocialIcon color="89f7fe">
            <Twitter />
          </SocialIcon>
          <SocialIcon color="ff0004">
            <Pinterest />
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center>
        <Title>Explore</Title>
        <List>
          <ListItem>Home</ListItem>
          <ListItem>Cart</ListItem>
          <ListItem>Men Fashion</ListItem>
          <ListItem>Accessories</ListItem>
          <ListItem>Order Tracking</ListItem>
          <ListItem>Widhlist</ListItem>
          <ListItem>My Account</ListItem>
          <ListItem>Terms</ListItem>
        </List>
      </Center>
      <Right>

      </Right>
    </Container>
  );
};

export default Fotter;
